import { Container, Icon, Grid } from '@material-ui/core';
import CopyrightIcon from '@material-ui/icons/Copyright';
import React, { Component, useState } from 'react';
import IconCpf from '@material-ui/icons/PermIdentity';
import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';
import { InputGroup, InputGroupAddon, InputGroupText } from 'reactstrap';
import { Collapse, Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink, UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem, NavbarText } from 'reactstrap';
import logoLogin from "./desenho/Logo.png"
import iconLogin from "./desenho/icone.png"
import './login_adm_css/login_adm.css';

class Login_adm extends Component {
    render() {
        return (
            <Container maxWidth="sm">
                <div className='espaco'>
                    <h2 className="text-center">Adicionar Funcionário</h2>
                    <form> <Grid container spacing={3}>
                        <Grid item xs={12}>
                            <TextField required autoFocus fullWidth id="nome" name="nome"
                                value={this.state.nome} onChange={this.onChange}
                                label="Nome" InputLabelProps={{ shrink: true, }} variant="outlined">
                            </TextField>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField required autoFocus fullWidth id="endereco" name="endereco"
                                value={this.state.endereco} onChange={this.onChange}
                                label="Endereço" InputLabelProps={{ shrink: true, }} variant="outlined">
                            </TextField>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField required autoFocus fullWidth id="cpf" name="cpf" fullWidth type="number"
                                value={this.state.cpf} onChange={this.onChange}
                                label="CPF" InputLabelProps={{ shrink: true, }} variant="outlined">
                            </TextField>
                        </Grid>
                        <Grid item xs={6}>
                            <TextField required autoFocus id="nascimento" name="nascimento" type="date" fullWidth
                                value={this.state.nascimento} onChange={this.onChange}
                                label="Data de Nascimento" InputLabelProps={{ shrink: true, }} variant="outlined">
                            </TextField>
                        </Grid>
                        <Grid item xs={6}>
                            <TextField required autoFocus id="admissao" name="admissao" type="date" fullWidth
                                value={this.state.admissao} onChange={this.onChange}
                                label="Data de Admissão" InputLabelProps={{ shrink: true, }} variant="outlined">
                            </TextField>
                        </Grid>
                        <Grid item xs={6}>
                            <TextField required autoFocus id="salario" name="salario" type="number" fullWidth
                                value={this.state.salario} onChange={this.onChange}
                                label="Salario" InputLabelProps={{ shrink: true, }} variant="outlined">
                            </TextField>
                        </Grid>


                    </Grid>
                        <br></br>
                        <Button variant="contained" color="primary" disableElevation onClick={(e) => { this.saveUser(e) }}>
                            Salvar
                                        </Button>
                    </form>
                </div>
            </Container>
        );
    }
}

export default Login_adm;
